import React, { createContext, useReducer } from 'react'
import IOReducer from '../reducers/IOReducer';

export const IOContext = createContext();

const IOStateObj = {
    initExport: false,
    exportPackage: [],
    importPackage: "data:image/png;base64,"
}

const IOContextProvider = (props) => {

    const [IOState, dispatch] = useReducer(IOReducer, IOStateObj);
    const IODispatch = dispatch;

    return (
        <IOContext.Provider value={{ IODispatch, IOState }}>
            {props.children}
        </IOContext.Provider>
    )
}

export default IOContextProvider;